import React, { useEffect, useState } from "react";
import axios from "axios";

export default function Prueba() {
  const [bajones, setBajones] = useState([]);

  useEffect(() => {
    axios
      .get("/prueba")
      .then((res) => {
        const data = res.data;
        setBajones(data);
      })
      .catch((err) => console.log(err));
  }, []);


  return (
    <div>
      <h1>


            <h1>{bajon.name}</h1>



      </h1>  
    </div>
  );
}
